import React from 'react';

const MyComponent = () => {
    function showSubMenu(element) {
        var submenu = element.querySelector('.submenu');
        if (submenu) {
          submenu.classList.add("show");
        }
      }

      function hideSubMenu(element) {
        var submenu = element.querySelector('.submenu');
        if (submenu) {
          submenu.classList.remove("show");
        }
      }
  return (
    <div>
      <div className="bg-primary d-flex flex-wrap align-items-center justify-content-center justify-content-md-between border-bottom fixed-top text-white p-2">
        Unidad Familia Medellin
      </div>
      <div className="bg-white opacity-1 mt-5 p-2 d-flex flex-wrap align-items-center justify-content-center justify-content-md-between border-bottom fixed-top">
        <div className="col-md-3 mb-2 mb-md-0">
          <img className="p-3" width="150" height="100" src="https://cdnwordpresstest-f0ekdgevcngegudb.z01.azurefd.net/es/wp-content/uploads/2022/03/Open-Graph-.png" alt="" />
          <a href="/" className="d-inline-flex link-body-emphasis text-decoration-none"></a>
        </div>
        <nav className="nav col-md-4 mb-2 justify-content-center mb-md-0">
          <ul className="nav">
            <li className="nav-item">
              <div className="menu-item" onMouseOver={showSubMenu} onMouseLeave={hideSubMenu}>
                <a href="./" className="nav-link px-2">Inicio</a>
              </div>
            </li>
            <li className="nav-item">
              <div className="menu-item" onMouseOver={showSubMenu} onMouseLeave={hideSubMenu}>
                <a href="#" className="nav-link px-2">¿Quienes somos?</a>
                <div className="submenu text-center div1">
                  <label className="liT mb-2"><a className="sub liT" href="#">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Contactenos&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </a></label><br />
                  <label className="liT"><a className="sub liT" href="#">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Unidad Familia&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</a></label>
                </div>
              </div>
            </li>
            <li className="nav-item">
              <div className="menu-item" onMouseOver={showSubMenu} onMouseLeave={hideSubMenu}>
                <a href="#" className="nav-link px-2">Noticias</a>
                <div className="submenu text-center div1">
                  <label className="liT mb-2"><a className="sub liT" href="#">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Contactenos&nbsp;&nbsp;&nbsp;&nbsp; </a></label><br />
                  <label className="liT"><a className="sub liT" href="#">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;SIOF&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;</a></label>
                </div>
              </div>
            </li>
            <li className="nav-item">
              <div className="menu-item" onMouseOver={showSubMenu} onMouseLeave={hideSubMenu}>
                <a href="#" className="nav-link px-2">Multimedia</a>
              </div>
            </li>
          </ul>
        </nav>
        <div className="col-md-3 text-end">
          <button type="button" className="btn me-2 login">Login UFM</button>
          <button type="button" className="btn btn-primary">Login Admin</button>
        </div>
      </div>
    
    
    </div>
  );
};

export default MyComponent;
